import NavBar from "./components/NavBar";
import FicheUser from "./pages/FicheUser";
import Home from "./pages/Home";

import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/",
    element: <App />,
  },
  {
    path: "/login",
    element: <App />,
  },
]);

function App() {
  return (
    <div style={{background:"#223"}}>
      <NavBar />
      <Home/> 
    </div>
  );
}

export default App;
